 const List = ({people}) => {
    return ( 
        <>
        {people.map((person)=>{
            const{id,name,age,image}=person;
return(
    <article key={id} className="person">
        <img src={image} alt={name}/>
        <div>
            <h4 class="text-bold text-xl">{name}</h4>
            <p>{age} years</p>

        </div>
    </article>
);
        })}
        </>
     );
 };
  
 export default List;
